import { useEffect } from "react";
import { useNavigate, useParams } from "react-router-dom";

export default function GetAccessToken(){
    const navigate = useNavigate()
    const a = useParams()

    useEffect(() => {
        console.log("==============")
        console.log(a)
        console.log("==============")

        navigate('/')
    }, [navigate]);



}
